import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';
import Layout from './components/Layout';

// Tạo theme mặc định
const theme = createTheme({
  palette: {
    primary: {
      main: '#1976d2',
    },
    secondary: {
      main: '#dc004e',
    },
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Router>
        <Layout>
          <Routes>
            <Route path="/" element={<div>Trang chủ</div>} />
            <Route path="/users" element={<div>Quản lý nhân sự</div>} />
            <Route path="/departments" element={<div>Quản lý phòng ban</div>} />
            <Route path="/cars" element={<div>Quản lý xe</div>} />
            <Route path="/assets" element={<div>Quản lý tài sản</div>} />
          </Routes>
        </Layout>
      </Router>
    </ThemeProvider>
  );
}

export default App;
